import React from 'react'
import Home from './pages/Home/Home'

const App = () => {
  return (
    <div>
      <div id="bg-img"><img src='../public/asserts/media/bg-img.png' alt='bg-img'></img></div>
      <Home />
    </div>
  )
}

export default App
